import React from 'react';
import './directory.styles.scss';

const Directory = ({ title, imageUrl }) => {
	return (
		<div
			className="directory-section"
			style={{
				backgroundImage: `url(${imageUrl})`,
				width: '100%',
				height: '100px'
			}}
		>
			<h2>{title}</h2>
			<span>Shop Now</span>
		</div>
	);
};
export default Directory;
